.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - -----------------------------------------------&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Clear task state&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO -   Scheduler at:   tcp://172.21.0.207:8786&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO -   dashboard at:                     :8787&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Receive client connection: Client-d25e4ec7-b3f8-11ed-ac98-080038b6ba03&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Register worker &amp;lt;WorkerState &amp;#x27;tcp://172.21.1.79:42703&amp;#x27;, name: tcp://172.21.1.79:42703, status: running, memory: 22, processing: 0&amp;gt;&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Starting worker compute stream, tcp://172.21.1.79:42703&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Register worker &amp;lt;WorkerState &amp;#x27;tcp://172.21.1.79:40113&amp;#x27;, name: tcp://172.21.1.79:40113, status: running, memory: 22, processing: 0&amp;gt;&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Starting worker comp
